        }
        this.loginUser = this.loginUser.bind(this);
    }
    changeState = e => {
        this.setState( {
            [e.terget.id]:e.terget.value
        })
    }
    loginUser = (event) => {
        console.log('new user', this.state);
    }
    render() {
        return (
            <div className = 'container'>
                <form className='form' onSubmit = {this.loginUser}>
                  <input id='username' placeholder='Enter you email' value={this.state.username} onChange = { e => this.changeState(e) } /> <br />
                  <input type='password' id = 'password' value={this.state.password} onChange = { e => this.changeState(e) } /> <br />
